lumn" style="padding-bottom:4em"><h2 class="section-heading" style="text-align:left">Powerful and flexible</h2><div class="text-limit text-intro" style="position:relative;"><svg class="kleine-hexen" width="73.826" height="58.426" viewbox="0 0 73.826 58.426" xmlns="http://www.w3.org/2000/svg"><g class="fill-green"><path d="m30.359 31.432 0.043 9.272a13.183 13.183 0 0 0 6.644 11.387l8.052 4.6a13.185 13.185 0 0 0 13.182-0.062l8.009-4.674a13.18 13.18 0 0 0 6.537-11.446l-0.044-9.273a13.177 13.177 0 0 0-6.644-11.384l-8.052-4.6a13.183 13.183 0 0 0-13.181 0.06l-8.01 4.675a13.18 13.18 0 0 0-6.537 11.446"></path><path d="m0.0010885 10.72 0.026 5.546a7.885 7.885 0 0 0 3.974 6.81l4.816 2.751a7.886 7.886 0 0 0 7.884-0.037l4.79-2.8a7.883 7.883 0 0 0 3.91-6.846l-0.026-5.546a7.881 7.881 0 0 0-3.974-6.809l-4.816-2.751a7.885 7.885 0 0 0-7.884 0.036l-4.791 2.8a7.883 7.883 0 0 0-3.91 6.846"></path><path d="m4.5051 43.422 0.017 3.661a5.206 5.206 0 0 0 2.624 4.5l3.18 1.816a5.207 5.207 0 0 0 5.206-0.025l3.163-1.846a5.2 5.2 0 0 0 2.581-4.52l-0.017-3.662a5.2 5.2 0 0 0-2.624-4.5l-3.18-1.815a5.206 5.206 0 0 0-5.205 0.024l-3.163 1.846a5.2 5.2 0 0 0-2.581 4.52"></path></g></svg><p>yEd is a powerful desktop application that can be used to quickly and effectively generate high-quality diagrams.
Create diagrams manually, or import your external data for analysis. Our automatic layout algorithms 
arrange even large data sets with just the press of a button.<br>yEd is <a href="yed/download#download">freely available</a> and runs on all major platforms: Windows, Unix/Linux, and macOS.</p><p>If you prefer to edit diagrams with an <a href="yed-live">online tool </a>or integrate them directly into <a href="https://www.graphity.com/" target="blank" rel="noopener">Atlassian confluence</a>, 
you can get an overview of our diagram editors <a href="../editors">here</a>.</p></div></div><div class="flex-column" style="flex:0 0 auto;"><div class="card-product" style="margin: 0 auto;"><svg class="card-product-bg" version="1.1" xmlns="http://www.w3.org/2000/svg" x="0px" y="0px" width="235.33px" height="138.594px" viewbox="0 0 235.33 138.594"><path class="fill-green" d="M0,0.002h235.146l0.184,39.26c0.111,26.104-13.699,50.287-36.238,63.453l-44.389,25.91c-22.543,13.168-50.401,13.299-73.066,0.342h0l-44.627-25.482C14.34,90.541,0.303,66.483,0.188,40.379"></path><defs><clippath id="card-product-clip-path"><path d="M0,0h235.146l0.184,39.26c0.111,26.104-13.699,50.287-36.238,63.453l-44.389,25.91c-22.543,13.168-50.401,13.299-73.066,0.342h0l-44.627-25.482C14.34,90.539,0.303,66.481,0.188,40.377"></path></clippath></defs><g clip-path="url(#card-product-clip-path)"><path fill="#242265" stroke="#242265" stroke-width="0.5" stroke-miterlimit="10" stroke-dasharray="3,1.5" d="M239.312,102.625l-24.918,14.426 M244.047-3.891v28.778 M239.312-6.66L214.394,7.767 M182.847-8.262l27.76,16.029 M212.5,11.044v32.058M210.606,46.38l-27.76,16.029 M214.394,46.38l27.76,16.029 M179.06-8.262L151.3,7.767 M50.029-6.66L25.112,7.767 M54.765-3.891v28.778 M180.953-7.17v32.057 M117.859-9.355v34.243 M144.67,47.984l-24.917,14.426 M154.142,47.984l24.918,14.426M149.405,50.751v28.779 M86.312,11.044v28.779 M81.576,47.984L56.659,62.409 M86.312,50.751v28.779 M-3.594-6.66L21.323,7.767M-8.33-3.891 M115.964,28.165L91.047,42.591 M56.659,28.165l24.917,14.426"></path><path fill="#242265" stroke="#242265" d="M244.047,61.316c1.208,0,2.187,0.979,2.187,2.186s-0.979,2.187-2.187,2.187c-1.207,0-2.187-0.979-2.187-2.187S242.84,61.316,244.047,61.316z M244.047,94.465c3.018,0,5.464,2.446,5.464,5.464c0,3.019-2.446,5.465-5.464,5.465s-5.464-2.446-5.464-5.465C238.583,96.911,241.029,94.465,244.047,94.465z M212.5,115.958c1.208,0,2.187,0.979,2.187,2.187c0,1.207-0.979,2.186-2.187,2.186s-2.187-0.979-2.187-2.186C210.313,116.937,211.292,115.