d1f54a77.png" loading="lazy" style="width: 100%;" width="549" height="208"><p>Import your own data from an Excel&reg; spreadsheet (.xls) or XML.</p></div><div class="flex-column"><h3>Create</h3><img src="../assets/images/yed/slide_interactive-interface.0bb933221c.png" loading="lazy" style="width: 100%;" width="550" height="210"><p>Create diagrams with ease via an intuitive user interface.</p></div><div class="flex-column"><h3>Arrange</h3><img src="../assets/images/yed/slide_arrange.3e9546efc2.png" loading="lazy" style="width: 100%;" width="549" height="208"><p>Automatically arrange your diagrams elements.</p></div><div class="flex-column"><h3>Export</h3><img src="../assets/images/yed/slide_export1.489ff0097d.png" loading="lazy" style="width: 100%;" width="549" height="208"><p>Export bitmap and vector graphics as PNG, JPG, SVG, PDF, SWF.</p></div></div><div class="text-center"><a class="material-button material-button-theme " href="yed/applicationfeatures">All features<svg xmlns="http://www.w3.org/2000/svg" width="16" height="1em" viewbox="0 0 7 6"><use href="#icon-arrow-right" style="fill: currentColor"></use></svg></a></div></div></section><section><div class="straight-waves bg-light-blue " style="margin: 3rem 0 5rem 0"><div class="straight-wave top-1 bg-light-blue "></div><div class="straight-wave top-2 bg-light-blue "></div><div class="straight-wave bottom-1 bg-light-blue "></div><div class="straight-wave bottom-2 bg-light-blue "></div><div class="straight-waves-content"><div class="width-limit content-width"><div class="yfiles-banner"><div class="flex-column"><p class="yfiles-banner-headline">The <span style="color: #ffffff;">enterprise solution </span>for <span style="color: #ffffff;">data visualization </span>and <span style="color: #ffffff;">graph drawing</span></p></div><div class="flex-column"><img class="yfiles-banner-image" src="../assets/images/yfiles-graphs-for-jupyter/yFiles-all-platforms.543f85a6a3.svg" loading="lazy" alt="yFiles logo for all platforms" width="262" height="128"></div><div class="flex-column"><p><div class="expandable-list white"><div class="list-item">Integrable into your application</div><div class="list-item">Suitable for any use case</div><div class="list-item">Highly customizable to fit your needs</div><div class="list-item">Compatible with any type of data </div></div></p><div class="text-right"><a class="material-button material-button-blue  slim" href="../yfiles-overview" target="_blank" rel="noopener">Discover more<svg xmlns="http://www.w3.org/2000/svg" width="16" height="1em" viewbox="0 0 7 6"><use href="#icon-arrow-right" style="fill: currentColor"></use></svg></a></div></div></div></div></div></div></section><section class="section-diagrams"><div class="anchor" id="samples"></div><div class="width-limit content-width"><img src="../assets/images/index/product-family-green-hex.d74e153fdd.svg" style="position:absolute;left:0;transform: translate(-40%);height:50vw;min-height:350px;max-height:600px;"><div class="section-diagrams-content"><div class="flex-row"><div class="flex-column"><h2>Supported Diagrams</h2></div></div><div class="flex-row flex-wrap"><div class="flex-column"><h3>BPMN Diagrams</h3><img src="../assets/images/yed/thumb_bpmn1.e53485c0e7.png" loading="lazy" width="160" height="100"></div><div class="flex-column"><h3>Semantic Networks</h3><img src="../assets/images/yed/thumb_semantic_network.2e1fecf7fe.png" loading="lazy" width="160" height="100"></div><div class="flex-column"><h3>Family Trees</h3><img src="../assets/images/yed/thumb_familytree.fb89ef732a.png" loading="lazy" width="160" height="100"></div><div class="flex-column"><h3>Flowcharts</h3><img src="../assets/images/yed/thumb_flowcharts1.153e544059.png" loading="lazy" width="160" height="100"></div><div class="flex-column"><h3>Social Networks</h3><img src="../assets/images/yed/thumb_social.4237078e57.png" loading="lazy" width="160" height="100"></div><div class="flex-column"><h3>UML Class Diagrams</h3><img src="../assets/images/yed/thumb_uml.9a01cb7959.png" loading="lazy" width="160" height="100"></div></div><div class="flex-row"><div class="flex-column" style="text-align: center"><h3>and many more...</h3></div></div></div></div></section><div class="width-limit content-width" style="padding-bottom: 2rem;"> <div style="text-align: center;"><h2>Frequently Asked Questions</h2></div><div class="faq-block"><div class="accordion"><div><input type="checkbox" name="radio" id="2dde02f45bf64"><label class="accordion-section" for="2dde02f45bf64"><span><div class="title">Can I use yEd for free, even for commercial purposes?</div><div class="bar"></div><div class="arrow"><svg class="fill-blue" xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewbox="8 5 16 16" style="width: 100%; height: 100%;"><path d="M0 0h24v24H0V0z" fill="none"></path><path d="M9.31 6.71a1 1 0 000 1.41L13.19 12l-3.88 3.88a1 1 0 101.41 1.41l4.59-4.59a1 1 0 000-1.41L10.72 6.7a1 1 0 00-1.41.01z" fill="currentColor"></path></svg></div></span><div class="accordion-content"><div class="faq-block__answer" style="padding-left: .5rem"><p>The use of yEd is free of charge, and you can even use yEd in a commercial environment at no cost.<br>yWorks grants you the right to use yEd as an application to create diagrams. This right comes for free for anyone that adheres to the yEd <a href="https://yworks.com/products/yed/license.html", target="_blank">Software License Agreement</a>. E.g. you are not allowed to distribute yEd on your own or use it in an automated process.<br><a href="https://yworks.com/downloads#yEd", target="_blank">Download yEd here</a>.</p><a href="../faq?sq=yed&amp;id=7005" target="_blank" title="Open link to the FAQ." rel="noopener"><svg class="faq-block__anchor-link" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M10.59,13.41C11,13.8 11,14.44 10.59,14.83C10.2,15.22 9.56,15.22 9.17,14.83C7.22,12.88 7.22,9.71 9.17,7.76V7.76L12.71,4.22C14.66,2.27 17.83,2.27 19.78,4.22C21.73,6.17 21.73,9.34 