position: absolute; left: 20%; top: 0; height: 130%;"><use class="fill-white stroke-white" href="#bg-graph-path"></use></svg><div style="position: relative; z-index: 1"><h3>Video tutorial</h3><p>This video tutorial shows how to create a flowchart diagram with yEd.</p><div class="yt yt-player aspect-16x9" data-src="//www.youtube-nocookie.com/embed/ujMhxPJnJCw"><img class="yt-image" src="../assets/images/youtube-thumbnails/ujMhxPJnJCw.65c6fab96c.png" loading="lazy" alt="" width="712" height="400"><div class="yt-content"><div class="yt-play-button hover-red"><svg class="yt-play-button-icon" xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewbox="0 0 24 24"><path d="M 3 0 V 24 L 24 12 Z"></path></svg><div class="yt-play-button-text">load from YouTube</div></div></div></div></div></div></div></div></div><section class="section-yed-technical"><div class="anchor" id="technical"></div><div class="width-limit content-width text-blue"><h2 class="section-heading" style="text-align:left;">Technical information</h2><div class="flex-row"><div class="flex-column" style="flex: 0 0 auto; margin-bottom: 2rem;"><div class="feature-card-container theme-yfiles"><div class="card-eye-catcher logo" style="margin: 0 auto;"><svg class="card-eye-catcher-bg" viewBox="0 0 421 69.8" width="421" height="69.8" xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="xMidYMin meet"><path class="fill-theme" d="m0 0v2.38c108 31.7 195 54.9 244 63.3 63.1 10.7 125-0.708 178-19.7v-46z"></path></svg><svg class="card-eye-catcher-icon" viewbox="0 0 94.6 100" width="94.6" height="100" xmlns="http://www.w3.org/2000/svg"><use class="fill-theme-alt logo-outer" href="#hex100"></use><g class="fill-theme logo-inner"><path d="m57.6 70.4a15.4 15.4 0 0 1 2.13 3.36 6.16 6.16 0 0 1-0.97 6.64 5.75 5.75 0 0 1-7.85 0.747 6.13 6.13 0 0 1-2.31-5.35 11.2 11.2 0 0 1 1.2-4.14 34.2 34.2 0 0 0 1.53-3.74 13.6 13.6 0 0 0 0.458-4.86 48.1 48.1 0 0 0-0.565-4.96 12.1 12.1 0 0 0-2.97-6.37 15.4 15.4 0 0 0-5.58-3.67c-0.917-0.38