yFiles - the industry-leading software library for visualizing, editing and analyzing graphs.</p><a class="material-button material-button-theme " href="../yfiles-overview" style="margin-top:3rem;">Discover more<svg xmlns="http://www.w3.org/2000/svg" width="16" height="1em" viewbox="0 0 7 6"><use href="#icon-arrow-right" style="fill: currentColor"></use></svg></a></div></div></div><div class="flex-column text-limit"><p>yEd is a pure Java Swing application. It runs on all Windows, Unix/Linux, and Mac OS versions where a suitable <a href="https://www.java.com/" target="_blank" rel="noopener">Java Runtime Environment</a> is available.</p><p>yEd is based on the <a href="yfiles">yFiles diagramming library</a>, which provides not only the automatic layout algorithms and analysis tools, but also the intuitive user interface that makes creating and editing diagrams so easy.</p><p>For its look and feel, yEd makes use of UI components from <a href="https://www.jidesoft.com/">JIDE Software</a>.</p></div></div></div></section><section class="section-yed-feedback"><div class="anchor" id="yed-feedback"></div><div class="width-limit content-width"><div class="flex-row"><div class="flex-column" style="min-width:0;"><h2>Feedback</h2><p class="text-limit">We hope that you find yEd to be an invaluable tool and as much fun to make diagrams as we do.<b> Spread the word </b>and recommend it to your friends on Facebook and Twitter!<br>We also invite you to blog about yEd or submit a nice review on <a href="https://alternativeto.net/software/yed/about/" target="_blank" rel="noopener">alternativeto.net</a>. </p><div style="position: relative"><div class="simple-slider text-pigeon-blue-dark simple-slider-nav-right block-quote-slider"><div class="swiper-container"><div class="swiper-wrapper"><div class="swiper-slide"><p class="block-quote text-pigeon-blue-dark">Thank you for providing such an excellent tool as yEd to the international community for free.<cite class="text-gray"><span><b>Dr. Stefan Palan</b>, Assistant Professor</span></cite></p></div><div class="swiper-slide"><p class="block-quote text-pigeon-blue-dark">Wow, what a great product. I used to draw computer network drawings back in the early 2000's, and only recently I needed to draw a wiring diagram for an electrical component map. And wow, I learned your program pretty quickly, I was able to do everything I needed to do and I am just so thankful. Great program!<cite class="text-gray"><span><b>Craig Fine</b>, Sales Manager, Alliance Fleet</span></cite></p></div><div class="swiper-slide"><p class="block-quote text-pigeon-blue-dark">Hi, I just wanted to write to let you know how much I appreciate your program, and how grateful I am that you offer it for free. It's very helpful, and I love using it. Thanks so much.<cite class="text-gray"><span><b>David Dugan</b>, Software Engineer / Embedded Programmer</span></cite></p></div><div class="swiper-slide"><p class="block-quote text-pigeon-blue-dark">yEd Desktop editor is awesome! I write a lot of request for approval documents and your yEd Desktop editor is what I use for the architecture diagrams. It's really great and it is free too! I had tried a few other diagramming tools from other organizations but yours seems to fit my needs the best.<cite class="text-gray"><span><b>David Joy</b>, System Administrator, Canadian Navy</span></cite></p></div></div></div><div class="swiper-pagination"></div></div></div></div><div class="flex-column" style="flex:0 0 auto;"><div class="card-eye-catcher logo" style="margin: 100px auto;"><svg class="card-eye-catcher-bg" viewBox="0 0 421 69.8" width="421" height="69.8" xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="xMidYMin meet"><path class="fill-green" d="m0 0v2.38c108 31.7 195 54.9 244 63.3 63.1 10.7 125-0.708 178-19.7v-46z"></path></svg><svg class="card-eye-catcher-icon" viewbox="0 0 94.6 100" width="94.6" height="100" xmlns="http://www.w3.org/2000/svg"><use class="fill-theme-alt logo-outer" href="#hex1